import React,{useState} from 'react'
import axios from "axios"
import {useNavigate } from 'react-router-dom';

function Register() {
    
    const [activeTab, setActiveTab] = useState('login');
     const [registerData, setRegisterData] = useState({
        name: '',
        email: '',
        password: '',
        repeatPassword: ''
      });
      const handleRegister = async (e,registerData) => {
        console.log("registerData",registerData);
        
        e.preventDefault();
        if (registerData.password !== registerData.repeatPassword) {
          alert("Passwords don't match!");
          return;
        }
        try {
          await axios.post('http://localhost:4000/api/user/register', registerData);
          
        } catch (error) {
          console.log(error.response)
          console.error('Registration failed:', error);
        }
      };
  return (
    <div>
       
       <form onSubmit={(e)=>handleRegister(e,registerData)}>
            <div className="form-outline mb-4">
              <input
                type="text"
                className="form-control"
                value={registerData.name}
                onChange={(e) => setRegisterData({...registerData, name: e.target.value})}
                placeholder="Name"
              />
            </div>


            <div className="form-outline mb-4">
              <input
                type="email"
                className="form-control"
                value={registerData.email}
                onChange={(e) => setRegisterData({...registerData, email: e.target.value})}
                placeholder="Email"
              />
            </div>

            <div className="form-outline mb-4">
              <input
                type="password"
                className="form-control"
                value={registerData.password}
                onChange={(e) => setRegisterData({...registerData, password: e.target.value})}
                placeholder="Password"
              />
            </div>

            <div className="form-outline mb-4">
              <input
                type="password"
                className="form-control"
                value={registerData.repeatPassword}
                onChange={(e) => setRegisterData({...registerData, repeatPassword: e.target.value})}
                placeholder="Repeat password"
              />
            </div>

            <li className="nav-item" role="presentation">
          <button 
            onClick={() => setActiveTab('register')}
          >
            Register
          </button>
        </li>
          </form>
        </div>
        
    
  )
}

export default Register
